import React from 'react';

const pages = Array.from(Array(10).keys()).map(x => x+1);

const Pagination = () => {

    return (
        <div className="pagination">
            {pages.map((page) =>
                <div>{page}</div>)}
        </div>
    )
};

export default Pagination;
